e. While you are not really required to have any previous experience with computer programming, you still need to have a basic understanding of the terms commonly used in programming and computers. You see, the C language is one of the most recommended computer programming languages for beginners. After all, it is a predecessor to many of the modern programming languages used today, such as Java and Python. In other words, before you can effectively learn these languages, you have to have a clear understanding of the C language first. Through this book, you will learn how to write your first programs and see how they work in real time. You have to keep in mind that it is perfectly okay to make mistakes every now and then. It is through these mistakes that you learn. So, when you encounter an error on your program, you just have to study the part where you went wrong and redo it. When you run the programs in the C language, you will be notified in case you made a mistake. You will see the error and know which line you have to modify. This book also teaches you how you can write the shortest programs possible, without negatively affecting your output. As a programmer, you want to make the most of your available time and space while still being efficient. You will also learn how to organise your codes and include remarks via comments so that you and your readers will not get confused. Here Is What You'll Learn After Downloading This C Programming Book: Table of Contents 1. C – Programming 2. C – An Overview 3. C – Environment Setup 4. C – Program Structure 5. C – Basic of C 6. C – Comments 7. C – Escape Sequence 8. C – Data Types 9. C – Void Data Types 10. C – Types Modifiers 11. C – Variable 12. C – Constants 13. C – Ivalue & rvalue 14. C – Integer Constants 15. C – Floating Point Constants 16. C – Character Constants 17. C – String Constants 18. C – const Keyword 19. C – Typedef 20. C – Enumerated Types 21. C – Type Casting 22. C – Standard input/output 23. C – Operators 24. C – Arithmetic Operators 25. C – Relational Operators 26. C – Logical Operators 27. C – Bitwise Operators 28. C – Assignment Operators 29. C – Operators Precedence 30. C – Flow Control 31. C – If Statements 32. C – If..else Statements 33. C – If..else if..else Statements 34. C – Nested If Statements 35. C – Switch Statements 36. C – For Loop 37. C – While Loop 38. C – Do While Loop 39. C – Arrays 40. C – Multidimensional Arrays 41. C – Strings 42. C – Pointers 43. C – Null Pointers 44. C – Pointer to Pointer 45. C – Storage Classes 46. C – Auto Storage Class 47. C – Register Storage Class 48. C – Static Storage Class 49. C – Extern Storage Class 50. C – Structure 51. C – Unions 52. C – File I/O 53. C – Writing a File 54. C – Reading a File 55. C – Preprocessors 56. C – Macros 57. C – Header Files 58. C – Functions 59. C – Function Call by Value 60. C – Function Call by Address 61. C – Function and Pointers 62. C – Functions and Pointers 63. C – Function Variable Scopes 64. C – Local Variables 65. C – Global Variables 66. C – Formal Parameters 67. C – Recursion 68. C – Error Handing 69. C – Memory Management What Are You Waiting For? Start Coding C Programming Right Now!","readingModes":{"text":false,"image":true},"pageCount":73,"printType":"BOOK","categories":["Architecture"],"maturityRating":"NOT_MATURE","allowAnonLogging":true,"contentVersion":"0.0.1.0.preview.1","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=oDgqEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=oDgqEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=oDgqEAAAQBAJ&printsec=frontcover&dq=programming&hl=&cd=8&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=oDgqEAAAQBAJ&dq=programming&hl=&source=gbs_api","canonicalVolu