class BookResponse {
  BookResponse({
      this.kind, 
      this.totalItems, 
      this.items,});

  BookResponse.fromJson(dynamic json) {
    kind = json['kind'];
    totalItems = json['totalItems'];
    if (json['items'] != null) {
      items = [];
      json['items'].forEach((v) {
        items?.add(BookModel.fromJson(v));
      });
    }
  }
  String? kind;
  int? totalItems;
  List<BookModel>? items;
BookResponse copyWith({  String? kind,
  int? totalItems,
  List<BookModel>? items,
}) => BookResponse(  kind: kind ?? this.kind,
  totalItems: totalItems ?? this.totalItems,
  items: items ?? this.items,
);
  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['kind'] = kind;
    map['totalItems'] = totalItems;
    if (items != null) {
      map['items'] = items?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}